import RegisterBg from './images/register-bg.jpg';
import LoginBg from './images/login-bg.jpg';
import Logo from './images/header-logo.png';

//Icon
import ICFacebook from './icon/ICFacebook.png';
import ICTwitter from './icon/ICTwitter.png';
import ICInstagram from './icon/ICInstagram.png';
import ICGithub from './icon/ICGithub.png';
import ICLinkedin from './icon/ICLinkedin.png';


export {RegisterBg, LoginBg, Logo}
